    false,nt"url": null,nt"notes": "This narrative report for Gulf Island National
    Wildlife Refuges (Petit Bois National Wildlife Refuge, Horn Island National Wildlife
    Refuge, and Breton National Wildlife Refuge) outlines Refuge accomplishments from
    September through December of 1963. The report begins by summarizing the weather
    conditions, habitat conditions, water conditions, and food and cover during this
    period. Wildlife- including migratory birds, upland game birds, furbearers, predators,
    rodents, and mammals- is also covered. The Refuge development and maintenance section
    discusses physical developments, collections and receipts, and prescribed burning.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, and safety. Items of interest and N-R forms are attached.",nt"owner_org":
